// src/pages/ProjectsPage.js
import React from 'react';
import ProjectList from '../components/ProjectList';
import ScrollAnimations from '../components/ScrollAnimations';

const ProjectsPage = () => {
    return (
        <div style={{
            padding: '2rem',
            backgroundColor: '#f9f9fb',
            fontFamily: 'Arial, sans-serif'
        }}>
            <h1 style={{
                fontSize: '2.5rem',
                textAlign: 'center',
                color: '#333'
            }}>My Projects</h1>
            <ScrollAnimations />
            <ProjectList />
            <section style={{
                marginTop: '2rem',
                padding: '1.5rem',
                backgroundColor: '#fff',
                borderRadius: '8px',
                boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
                textAlign: 'center'
            }}>
                <h2 style={{
                    fontSize: '2rem',
                    color: '#333',
                    marginBottom: '0.5rem'
                }}>Featured Projects</h2>
                <p style={{
                    fontSize: '1rem',
                    color: '#666',
                    marginBottom: '1.5rem'
                }}>Here are some of the standout projects Iâ€™ve worked on:</p>
                <div style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
                    gap: '1rem'
                }}>
                    {/* You can add project highlights here as necessary */}
                </div>
            </section>
        </div>
    );
};

export default ProjectsPage;
